text_show:
Crumble - una postaria inglesa tradiziunale, chì vi aiutavvi à qualsiasi situazione, soprattuttu s'ellu si invitati si mette in u minimu! Vi offre noi parechji ricetti per fà u mulinu cù pomi.
Crumble bi prugnori è i rubardi
Ingredients:
Per u riposu:
- prugna - 3 pedichi;
- raspberries freschi - 1 item;
- Cognac - 25 ml;
- zucchero - 3 tbsp. spese;
- acqua - 1 tbsp. cucchiaio;
- fèminu - 1 cullapura.
Per miglii:
- farina - 115 g;
- flakes - 90 g;
- zuccaru - 100 g;
- Cinnamia di terra - 0,5 Tsp
... (673 chars skipped) ... 
na à u canna. Aghjunghjite a frasi di mantellu cremosi è fate tuttu ciò chì a furia hè furmata. Dopu questu, u mette nantu à u riposu è pugnale sottu u cullone. Mandu mandà cuminzatu in u furmulaghju cale finu à 180 ° è aghjunghjela durante 45 minuti. Avemu servitu u pianu bellu, cù una crema battiata o una bola di gelato di vellinu.
Crumble bi prugne è u chocolate
Ingredients:
Per a prova:
- burro - 150 g;
- granulu di zuccaru - 100 g;
- farina - 150 g;
- ginger mozzu - 1 cullaretta;
- Chocolat
