- Salon di coconut - 0,25 st.
- Mantequilla - 80 g.
Preparazione
Pijanti senza pichjate è tagliate in pezzi di pirasi putemu in un pailimentu deep, fate u zuccaru, fremenu in l'acqua è coccianu nantu à u focu bellu durante 10 minuti, finu à chì hè fieru. Allora turnemu a mutazione di frutta in un pane di panificà è copre cù un capru di mirtusa. Per a so preparazione, mischjianu u floccato, u zuccaru granulatu, coccu di coccu è u oliu friddu. Agghiunciu u crabu durante 20 minuti, finu à culisimu.
